import React, { useEffect, useState } from 'react'
import TableHeaderBox from './TableHeaderBox'

export default function TableHeaders(props) {
  // I am expecting a inturn of header key names here!
  return (
    <div className='grid grid-'>
        {props.data.map(data => <TableHeaderBox key={data} headerName={data}></TableHeaderBox>)}
    </div>
  )
}
